const Postlist = ({ Posts }) => {
  render()
      {return (
        <div>
          {
            Posts.map((user, i) => {
              return (
                <Personal_blog
                  key={i}
                  id={Posts[i].id}
                  name={Posts[i].name}
                  email={Posts[i].email}
                  />
              );
            })
          }
        </div>
      );
    }
}

export default Postlist;
